    if(action.type === 'data') {
    var buttonList = [];
    var maxPage = this.state.total / this.limit;
    for(var i=0; i<maxPage; i++) {
    buttonList.push(<Button style={style.btnPage} 
    value={i} 
    onClick={this.handleClick}>{i+1}</Button>);
    }

    } else {
        return data;
    }
